import React from "react";
import Container from "@material-ui/core/Container";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import FormControl from "@material-ui/core/FormControl";
import TextField from "@material-ui/core/TextField";
import InputAdornment from "@material-ui/core/InputAdornment";
import Typography from "@material-ui/core/Typography";

import "./Main.css";

function Main() {
  return (
    <main class="main">
      <Container fixed>
        <Paper elevation={2} className="main__container">
          <Typography variant="h5" gutterBottom>
            Enter two prime number <em>P</em> and <em>Q</em>, such that{" "}
            <em>P * Q</em> is greater than 256.
          </Typography>
          <Grid container spacing={3} className="main__form">
            <Grid item xs={6}>
              <FormControl
                fullWidth
                className="main__formControl"
                variant="outlined"
              >
                <TextField
                  id="outlined-adornment-amount"
                  onChange={console.log("Changed P")}
                  variant="outlined"
                  label="Enter a prime number"
                />
              </FormControl>
            </Grid>
            <Grid item xs={6}>
              Somaer
            </Grid>
          </Grid>
        </Paper>
      </Container>
    </main>
  );
}

export default Main;
